import React, {Component} from 'react';

class ABG extends Component {
	render() {
		return(
			<div>
		<h1> Take Note !</h1>

<h3>This resource is a learning support to be used with appropriate clinical judgement and supervision.</h3>

<h1>Absolute contraindications</h1>
<ul>
<li>Overlying skin infections</li>
<li>Arterio-venous fistula</li>
<li>Arterial disease with inadequate circulation to the extremity</li>
</ul>

<h3>If you are unsure, ASK !</h3>


<h1>Equipment Required</h1>
<ul>
<li>Disposable kidney dish >> image</li>
<li>Non sterile gloves >> image</li>
<li>Alcohol wipe >> image</li>
<li>Local Anaesthetic (if indicated – requires supervision) >> image</li>
<li>ABG syringe and needle >> image</li>
<li>Gauze/tape or « sticky dot » >> image</li>
<li>Sharp’s bin >> image</li>
</ul>

<h5>See all equipment >> image</h5>




</div>
		);
	}
}

export default ABG;
